def calculate_distances(origin_lat, origin_lng):
    # Calculate distances between the origin and each charger
    distances = []
    for charger in chargers:
        charger_lat = charger["latitude"]
        charger_lng = charger["longitude"]
        distance = geodesic((origin_lat, origin_lng), (charger_lat, charger_lng)).kilometers
        distances.append({"charger_id": charger["id"], "distance": distance, "latitude": charger_lat,
                          "longitude": charger_lng})

    # Sort distances and return the five shortest ones
    sorted_distances = sorted(distances, key=lambda x: x["distance"])
    five_shortest_distances = sorted_distances[:5]
    return five_shortest_distances

# Flask route for handling requests related to the origin location
@app9.route('/origin', methods=['GET', 'POST'])
def get_origin():
    if request.method == 'GET':
        # Handle GET request if needed
        # Retrieve latitude and longitude from the query parameters
        lat = request.args.get('lat')
        lng = request.args.get('lng')

        # Return a JSON response with the retrieved latitude and longitude
        return jsonify({
            "latitude": lat,
            "longitude": lng
        })
    elif request.method == 'POST':

        # Retrieve latitude and longitude from the request's JSON body
        data = request.get_json()

        if 'lat' in data and 'lng' in data:
            lat = data['lat']
            lng = data['lng']

            # Calculate the five shortest distances
            five_shortest_distances = calculate_distances(lat, lng)

            # Return the results to the client
            return jsonify({
                "latitude": lat,
                "longitude": lng,
                "five_shortest_distances": five_shortest_distances
            })
        else:
            # Return an error response if latitude and longitude are missing
            return jsonify({"error": "Latitude and longitude are required."}), 400

